import React from 'react'
import "./Upload.css"

const Upload = ({setOpen}) => {
  return (
    <div className='upload_con'>
      <div className='upload_wrapper'>
        <div className='close'>X</div>
        <div className='upload_title'>Upload a new video</div>
      </div>
    </div>
  )
}

export default Upload
